class Solution:
    def maximumLength(self, nums: List[int], k: int) -> int:
        l_k = [0]*(k+1) # Longest length at k
        d = {} # num: [Longest length at k]
        for num in nums:
            if num not in d:
                d[num] = [0]*(k+1)
            for i in range(k, 0, -1):
                d[num][i] = max(d[num][i]+1, l_k[i-1]+1)
                l_k[i] = max(l_k[i], d[num][i])
            d[num][0] += 1
            l_k[0] = max(l_k[0], d[num][0])
        return max(l_k)
